import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Harmony Link</h1>
        <p>Helping immigrant women to integrate into their new environment</p>
      </header>
      <main>
        <div className="petal-container">
            <div className="center-element">
                <input type="text" placeholder="Search..." />
            </div>
          <div className="petal health">Health</div>
          <div className="petal wellbeing">Well-being</div>
          <div className="petal cultural">Cultural</div>
          <div className="petal language">Language Learning</div>
          <div className="petal domestic-violence">Domestic Violence & Cybercrime</div>
        </div>
      </main>
    </div>
  );
}

export default App;
